import React from 'react'

function Charrow(props) {
    return (
        <div className= 'row' onClick = {() => props.profilerend(props.var.name) }>
            <div className="col-sm-2">{props.var.name}</div>
            <div className="col-sm-6">{props.var.occupation}</div>
            <div className="col-sm-2">{props.var.birthday}</div>
            <div className="col-sm-2">{props.var.status}</div>
        </div>
    )
}

export default Charrow;
